import React from 'react';

class GameCard extends React.Component{

    render() {
        console.log(this.props)
        return(
            <div style={{paddingTop:'50px'}}>
                <span style={{paddingRight:'50px'}}>{this.props.fixtures[0]}</span>vs<span style={{paddingLeft:'50px'}}>{this.props.fixtures[1]}</span>
                <div>Time : {this.props.fixtures[2]}</div>
            </div>
        )
    }



}

export default GameCard
